import React from 'react';
import './Watchlist.css';

const Watchlist = () => {
  return (
    <div className="watchlist">
      <h2>Your Watchlist</h2>
      <p>Here you can manage your watchlist.</p>
    </div>
  );
};

export default Watchlist;
